import React from 'react';
import Logo from './header/Logo';
import Cadastro from './form-cadastro/Cadastro';

export default class Formulario extends React.Component{
	render(){
		return(
			<div className='formulario'>
				<Logo/>
				<Cadastro/>
			</div>
		)
	}
}
